    "Modeling Unsteady Cavitation Effects and Dynamic Loads in Cryogenic Systems Project",nt"tracking_summary":
    {ntt"total": 2,ntt"recent": 1nt},nt"groups": [],nt"relationships_as_subject":
    [],nt"revision_timestamp": "2015-05-06T22:08:27.171304",nt"name": "modeling-unsteady-cavitation-effects-and-dynamic-loads-in-cryogenic-systems-project",nt"isopen":
    true,nt"url": null,nt"notes": "There currently are no analytical or CFD
    tools that can reliably predict unsteady cavitation dynamics in liquid rocket turbopumps.
     Cavitation effects, particularly at low-flow, off-design conditions, generate
    large amplitude pressure fluctuations that result in performance loss, and may interact
    with other components to generate damaging system-wide instabilities. The innovation
    proposed here is the development of a numerical tool that can predict amplitudes
    and frequencies of dynamic pressure loads in cryogenic turbopumps.  This innovation
    will address the inclusion of advanced unsteady cavitation models for cryogenic
    fluids, development of boundary conditions that include interactions with other
    system components, and unsteady turbulence models for off-design conditions.  The
    resulting product, a specialized version of the multi-element unstructured CRUNCH
    CFD&lt;SUP&gt;REG&lt;/SUP&gt; code, will be a well-validated and reliable analysis
    tool that can be used to predict off-design performance of liquid rocket turbopumps.
     Furthermore, this tool can provide unsteady loading information necessary for
    stress and fatigue life modeling of inducer blades. It would also be able to quantify
    an inducer's mean head breakdown characteristics as a function of design variables.
    Thus this simulation software will be used for providing design support, as well
    as being an analysis tool for diagnosing cavitation related anomalies in operational
    systems.",nt"license_title": "U.S. Government Work",nt"extras": [{ntt"key":
